import React from 'react';
import Tilt from 'react-tilt';
import ray from './manta-ray-shape.png';
import './Logo.css';

const Logo = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className="Tilt br2 shadow-2" options={{ max : 75 }} style={{ height: 150, width: 150 }} >
             <div className="Tilt-inner"> <img style={{paddingTop:'20px', height:75}} src={ray}/> </div>
            </Tilt>
        </div>
    )
}

export default Logo;
